import { Container } from '@mui/material'
import Box from '@mui/material/Box'
import React from 'react'
import { Outlet } from 'react-router-dom'

const AuthLayout = () => {
  return (
    <div>
      <Container component="main" maxWidth="xs">
        <Box sx={{
          marginTop: 8,
        }}> Notionクローン開発</Box>
      </Container>
      <Outlet/>
      </div>
  )
}

export default AuthLayout
